import React, { useState } from "react";
import "./css/DoctorLogin.css";

import { useNavigate} from "react-router-dom";
import DoctorDashboard from "./DoctorDashboard";
import { useEffect } from "react";

const DoctorLogin = () => {
  const [userName, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [userError, setUserError] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userType, setUserType] = useState("doctor");
  const [doctorList, setDoctorList] = useState([]);
  const [key1, setKey1] = useState(null);
 
  const validateUsername = (userName) => {
    console.log("in the validation methjod of User name");
    // console.log(doctorList);
    //     doctorList.map((doctor,index)=> {
    //       if(doctor.doctorName===userName){
           
    //         console.log("the ID is: ", index+1);
    //         setKey1(index+1);
    //         console.log(key1);
    //         console.log("the full name is: ", doctor.doctorName);}
    //       })

    return userName;

  };
  const navigate = useNavigate();

  // useEffect(() => {
  //   const fetchDoctorList = async () => {
  //     try {
  //       const response = await fetch(
  //         "http://localhost:8080/Services/Health/getDoctorList"
  //       );

  //       if (!response.ok) {
  //         throw new Error("Failed to fetch");
  //       }

  //       const data = await response.json();
  //       setDoctorList(data); 
       
  //     } catch (error) {
  //       console.error("Error fetching doctor list:", error);
  //     }
  //   };


  //   fetchDoctorList();
  // }, []); 

  const handleLogin = async () => {
    if (!validateUsername(userName)) {
      setUserError("");
      setUserError("Please provide the correct username");
      return;
    }
  
    if (userName && password) {
      // Fetch the doctor list again to ensure it's up-to-date
      try {
        const response = await fetch(
          "http://localhost:8080/Services/Health/getDoctorList"
        );
  
        if (!response.ok) {
          throw new Error("Failed to fetch doctor list");
        }
  
        const data = await response.json();
        setDoctorList(data); // Update the doctorList with the latest data
  
        // Find the index of the doctor username
        const foundDoctor = data.find((doctor) => doctor.doctorName === userName);
  
        if (foundDoctor) {
          const index = data.indexOf(foundDoctor) + 1; // Get the index (+1 to make it 1-based)
          setKey1(index);
          console.log("the ID is: ", index);
        } else {
          // Handle case when the username is not found
          console.log("Doctor username not found");
        }
  
        // Create an object with the user's credentials
        const userCredentials = {
          userName,
          password,
          userType,
          id: key1 // Use the updated key1 value
        };
  
        // Proceed with the authentication
        const authResponse = await fetch(
          "http://localhost:8080/Services/Health/AuthenticateUser",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json"
            },
            body: JSON.stringify(userCredentials)
          }
        );
  
        // Handle authentication response here
  
        // Clear form fields or perform other actions after processing the response
        setUsername("");
        setPassword("");
      } catch (error) {
        console.error("Error during login:", error);
        alert("Login failed");
      }
    }
  };
  
  return (
    <div className="login-container">
      <div className="login-form">
        <h2>Login</h2>
        <form>
          <div className="form-group">
          <h1>{key1}</h1>
            <input
              // type="email"
              type="text"
              id="form3Example3"
              className={`form-control form-control-lg ${
                // emailError ? "is-invalid" : ""
                userError ? "is-invalid" : ""
              }`}
              placeholder="Enter a valid user name"
              // value={email}
              value={userName}
              // onChange={(e) => setEmail(e.target.value)}
              onChange={(e) => setUsername(e.target.value)}
              required
            />
            <label htmlFor="username">Username</label>
            {setUserError && (
              <div className="invalid-feedback">{userError}</div>
            )}
          </div>
          <div className="form-group">
            <input
              type="password"
              id="form3Example4"
              className="form-control form-control-lg"
              placeholder="Enter password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <label htmlFor="password">Password</label>
            {/* <input type="password" id="password" name="password" /> */}
          </div>
          <button
            type="button"
            style={{ paddingLeft: "2.5rem", paddingRight: "2.5rem" }}
            onClick={handleLogin}>
            Login
          </button>
        </form>
      </div>
      <div className="login-image">
        <img
          src="https://as1.ftcdn.net/v2/jpg/02/58/30/24/1000_F_258302473_TN25oZ5Dt9MYHPEr5vAD62cUgRBSwNAG.jpg"
          alt="Login Image"
          // style={{ width: "500px", height: "200px", borderRadius: "10px" }}
        />
      </div>
    </div>
  );
};

export default DoctorLogin;
